import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import {
    ComposableMap,
    ZoomableGroup,
    Geographies,
    Geography,
} from "react-simple-maps"

class App extends Component {
    render() {
        return(
            <div>
                <ComposableMap>
                    <ZoomableGroup>
                        <Geographies geography={ "./public/IND_adm.json" }>
                            {(geographies, projection) => geographies.map(geography => (
                                <Geography
                                    key={ geography.id }
                                    geography={ geography }
                                    projection={ projection }
                                />
                            ))}
                        </Geographies>
                    </ZoomableGroup>
                </ComposableMap>
            </div>
        )
    }
}

export default App;
